import React from 'react'

export const PortfolioList = ({title}) => {
  return (
    <li className='rounded-lg bg-light-grey/10 px-4 py-2 font-semibold tracking-wider hover:cursor-pointer hover:bg-light-grey/50'>
        {title}
    </li>
  )
}
